import React from 'react';
import { NavLink } from 'react-router-dom';

export const FoodExportAssistant = () => {
  const questions = [
    {
      questoin: `What's`,
    },
    {
      questoin: `What's in`,
    },
    {
      questoin: `What's in your`,
    },
    {
      questoin: `What's in your mind?`,
    },
    {
      questoin: `What's in your mind?...`,
    },
  ];
  return (
    <>
      <div className='w-full h-[100vh] flex items-center justify-center'>
        <div className='w-[20%] shadow-[4px_-2px_46px_0px_rgba(0,_0,_0,_0.1)] h-[95%] rounded-xl'>
          <div className='p-3'>
            <NavLink to='home' className={'block w-full font-bold'}>
              <h1 className='font-poppins font-bold text-[38px]'>TMF</h1>
            </NavLink>
          </div>
          <div className='w-[100%] bg-[#E9EDF7] h-[1px] mt-5'></div>

          <div className='flex w-[100%] justify-center gap-3 pt-8'>
            <div className='w-[24px] h-[24px]'>
              <img src={process.env.PUBLIC_URL + '/images/AIlogo.png'} />
            </div>
            <h2 className='font-bold font-Poppins text-[16px]'>
              Food Export Assistant
            </h2>
          </div>
          {questions.map((item, idx) => {
            return (
              <div className='flex w-[70%] ml-auto mr-auto justify-start gap-3 pt-7'>
                <div className='w-[18px] h-[16px]'>
                  <img src={process.env.PUBLIC_URL + '/images/chatIcon.png'} />
                </div>
                <h2 className=' font-Poppins text-[14px] text-[#00000066]'>
                  {item.questoin}
                </h2>
              </div>
            );
          })}

          <div className='w-[85%] p-5 ml-auto mr-auto rounded-md text-center gap-3 flex flex-col bg-custom-gradient'>
            <h3 className='font-bold font-Poppins text-[18px] text-white'>Go unlimited with TMF</h3>
            <p className='font-medium font-Poppins text-[14px]  text-white'>
              Get your exports to another level and start doing more with TMF AI
              Tools!
            </p>
            <button className=' text-white p-3 bg-[#ffffff24] rounded-md'>Get started with TMF</button>
          </div>
        </div>
        <div className='w-[77%]  h-[95%] p-5'>
          {/* HEAD */}
          <div className='flex'>
            <h1 className='font-bold font-Poppins text-[34px]'>
              Food Export Assistant
            </h1>
          </div>
        </div>
      </div>
    </>
  );
};
